import React from 'react'

function BookCard(props) {
  const img = `https://covers.openlibrary.org/b/isbn/${props.isbn} -L.jpg`

  return (
    <div>
        <img src={img} alt='cover'></img>
        <h1>{props.bookname}</h1>
    </div>
  )
}

export default BookCard
